import List from './List'
import store from './store';

function App(props) {


  return (
    <main className='App'>
      <header class="App-header">
        <h1>Trelloyes!</h1>
      </header>
      <div class="App-list">
    {props.store.lists.map(list=> {
      return (
          <List header={lists.header} cards={list.cardIds.map(card =>{
            return(
              props.store.allCards[card]
            )
          })
          } key={list.id}/>   
        );
      })
    }      
      </div>
    </main>
  );
}

export default App;
